from bs4 import BeautifulSoup

# Função para extrair links e CNPJs de um HTML
def extrair_cnpjs(html_content):
    # Parse o conteúdo HTML
    soup = BeautifulSoup(html_content, 'html.parser')

    # Encontre todos os links (tags <a>) e extraia os href
    links = [a['href'] for a in soup.find_all('a', href=True)]

    # Extraia apenas os CNPJs (última parte do link após o '-')
    cnpjs = [link.split('-')[-1] for link in links]

    return cnpjs

